                      //If there is no ACS data for selected year (ACS data released later than claims data), show last 7 years that are available\n                            else if (unique_years.indexOf(get_selections().Year)<0){\n                                first_year = unique_years.length-7;\n                                last_year = unique_years.length;\n                            }\n                        }\n                            else{\n                                if (unique_years.length-unique_years.indexOf(get_selections().Año)<=7){\n                                first_year = unique_years.length-7;\n                                last_year = unique_years.length;\n                                //console.log("TestACS")\n                            }\n                            //If there is no ACS data for selected year (ACS data released later than claims data), show last 7 years that are available\n                            else if (unique_years.indexOf(get_selections().Año)<0){\n                                first_year = unique_years.length-7;\n                                last_year = unique_years.length;\n                            }\n                            }\n                            //console.log("FirstYear"+first_year);\n                            //console.log(last_year);\n                            \n                            //http://c3js.org/samples/timeseries.html\n                            //var x_column = [year_label].concat(unique_years);\n                            var x_column = [year_label].concat(unique_years.slice(first_year, last_year)); //.map(function(_){ return _toString(); }))\n                            if (unique_measure_category==="English Proficiency") {\n                                var x_column = [year_label].concat(unique_years.slice(0, 10))\n                            }\n                            var columns = [x_column];\n                            var category_behavior = measure_category_behavior[unique_measure_category];\n                            var all_values = [];\n\n                            if (!category_behavior) {\n                                console.error('No category behavior for unique_measure_category "', unique_measure_category, '"');\n                                return;\n                            }\n\n                            nest_measure_then_year_map\n                                /*\n                                    .entries()\n                                    .sort(function(a,b){\n                                        //TODO: if you want to sort the legend, use this\n                                        return 1; //d3.ascending();\n\n                                    })\n                                    */\n                                .forEach(function (unique_measure_code, year_value_map) {\n\n                                    unique_measure_label = category_behavior.get_measure_label(unique_measure_code);\n\n                                    //year_values won't have ALL years in it; i.e. if a given measure didn't have a value in year 2012, then year_values won't include that year\n                                    //So I must use unique_years\n                                    var uyr = unique_years\n                                    //Edit syntax\n                                    if ((unique_measure_code === 'C575') || (unique_measure_code === 'C576')){\n                                        //If measure related to English proficiency on a county level, pulls all years\n                                            uyr = unique_years.slice(first_year, 10)\n                                    }\n                                    else if ((unique_measure_code === 'C581') || (unique_measure_code === 'C582') || (unique_measure_code === 'C583') || (unique_measure_code === 'C584') || (unique_measure_code === 'C585') || (unique_measure_code === 'C586')){\n        