         //TODO: CSS instead to toggle display\n                d_no_chart_rect.style({\n                    display: 'block'\n                })\n                d_no_chart_message.style({\n                    display: 'block'\n                })\n\n                d_no_chart_message.selectAll("tspan")\n                    .data(no_data_msg).enter()\n                    .append("tspan")\n                    .attr("x", "50%")\n                    .attr("dy", function (d, i) { return i === 0 ? "0" : "1em"; })\n                    .text(function (d) { return d; });\n\n            } else {\n\n                d_no_chart_rect.style({\n                    display: 'none'\n                })\n                d_no_chart_message.style({\n                    display: 'none'\n                })\n            }\n\n            //======================\n            //Table part\n            //======================\n            // http://stackoverflow.com/questions/6987005/create-a-table-in-svg\n            //https://jsfiddle.net/ak7zhh1h/\n            //TODO: Not a d3 pattern; use exit selection\n            //d_trend_table\n            d_trend_table\n                .selectAll('*')\n                .remove();\n\n            var d_trend_col = d_trend_table\n                .selectAll('text.col')\n                .data(c3_column_data[0]);\n            //Adjust table alignment\n            var th_width = 220;\n            var td_width = 50;\n\n            var cell_offset = function (data, index) {\n\n                return index == 0 ? 0 : (th_width + td_width * (index - 1));\n\n            };\n\n            //This is the level that data() is bound\n            d_trend_col\n                .enter()\n                .append('text')\n                .classed({\n                    col: true,\n                    'first-col': function (d, i) {\n                        return i === 0;\n                    }\n                })\n                //Move each col\n                .attr({\n                    x: cell_offset,\n                    'text-anchor': 'left'\n                });\n\n            var row_height = '1.25em';\n            var header_height = '1.6em';\n\n            d_trend_col\n                .append('tspan')\n                .attr({\n                    x: cell_offset\n                })\n\n                .classed({\n                    th: true,\n                    bold: true,\n                    'left-align': function (d, i) {\n                        return i === 0;\n                    },\n                    'first-of-first': function (d, i) {\n                        return i === 0;\n                    }\n                })\n                .text(function (d, i) {\n                    return i === 0 ? truncate_legend_header(d) : d;\n                })\n\n            //Zero-based index at which to end extraction. slice extracts up to but not including end.\n            jurisdiction_rows = c3_column_data.splice(1);\n\n            jurisdiction_rows.forEach(function (jurisdiction_row, row_index) {\n\n                d_trend_col\n                    .append('tspan')\n                    .classed({\n                        'left-align': function (d, i) {\n                            return i === 0;\n                        }\n                    })\n                    .attr({\n                        x: cell_offset\n                    })\n                    .attr('dy', row_index == 0 ? header_height : row_height)\n                    .text(function (data, index) {\n                        //If it's the first index, don't need to repeat the county\n                        var text_val = jurisdiction_row[index];\n\n                        var formatter = get_d3_formatter(menuChange(), 'nontrend');\n                        if (text_val === undefined) { return 'N/A'; }\n                        if (text_val === 'N/A') { return 'N/A'; }\n\n                        try {\n\n                            var formatted_val = formatter(text_val);\n                            //'NaN' ? text_val : formatter(text_val); //if NaN reflect N/A else 0 or actual value\n                        } catch (e) {\n                            var formatted_val = 'N/A';\n                        }\n\n                        return index == 0 ? ellipsize(text_val) : formatted_val;\n\n                    });\n\n            })\n\n        };\n\n        var load_trend_view = function () {\n\n            CUMULATIVE_Y_TRANSLATE = 0;\n\n            toggle_loading_screen('view', true);\n            map_maximize(false);\n\n            hide_all_views();\n\n            var current_options = menuChange();\n\n            if (current_options.population =='f'){\n                var trend_year_val = get_trend_year_option().value;\n            }\n            else\n            {\n                var trend_year_val = get_trend_year_option_MA().value;\n            }\n            \n            //Convert a range of two to all in-between years\n            //TODO: Maybe better to just use min and max in the year range?\n            var years = ranged(range_splitter(trend_year_val).map(int_parser));\n\n            var year_queue = queue();\n\n            var year_label = 'Year';\n\n            //Another small functor\n            var year_data = years.map(function (y) {\n                return get_year_label(y.toString()) || y;\n            });\n\n            var year_labeled_data = [year_label].concat(year_data);\n\n\n            ///Here we get from year[0]\n            years.forEach(function (year) {\n\n                year_opt = cloneObject(current_options);\n\n                //Made it an int for ranged, back to string\n                //TODO: have ranged handle appropriately; return string if string\n                year_opt.year = year.toString();\n\n                //https://jira.us.kworld.kpmg.cfom/projects/NORCCMS/issues/NORCCMS-21?filter=allissues\n                var year_deferrable = get_option.analysis.is_base(year_opt) ? parse_and_cache_all_jurisdictions_years_json_data : parse_and_cache_years_json_data;\n                \n\n                year_queue\n                    .defer(year_deferrable, year_opt);\n\n                //End foreach years\n            });\n\n            //After passing *awaitAll* (which pacts all accumulated deferred args into a single array)\n            //year_datas is no longer one array with three elements (one for each year).\n            //year_datas is an array with 3 elements, (one for each year), *each of which has three elements* (one for each jurisdictional level)\n            //And after adding code which chooses awaiter whether is_based() is true or not, only the base_trend_awaiter will receive those args\n            //Wish that I could define this\n            var non_base_trend_awaiter = function (error, year_datas) {\n\n                if (!year_datas && error) {\n                    //error is an XHR object, for example, when you're offline and so the XHR fails\n                    console.error(error);\n                    return;\n                }\n\n                //An array with three elements\n                //Each element is an object where keys are the jurisdictions, at whatever level is appropriate (county, state)\n                //last_jurisdiction_selected_id is the id of the last selected jurisdiction, at whatever level is appropriate (county, state)\n                var jurisdiction_full_data = year_datas.map(function (all_juris_data) {\n\n                    var datum = all_juris_data[last_jurisdiction_selected.id];\n\n                    return datum;\n\n                });\n\n                //Ironically you'll never have a non-analysis, aka where is_base() is true\n                //Because we preclude that from happening; on the outside we check if it's base and we call base_trend_awaiter instead\n                //But it was a nice failover to add while coding, now even this non_base_trend_awaiter can accomodate that\n                var is_analysis = !get_option.analysis.is_base(current_options); //is_trend(current_options);\n\n                var jurisdiction_data1 = jurisdiction_full_data.map(function (_) {\n                    //https://jira.us.kworld.kpmg.com/browse/NORCCMS-33\n                    if (typeof _ === 'undefined' || _.V1 === null) { return 'N/A'; }\n                    return _ && _.V1\n                });\n                var jurisdiction_data2 = jurisdiction_full_data.map(function (_) {\n                    //https://jira.us.kworld.kpmg.com/browse/NORCCMS-33\n                    if (typeof _ === 'undefined' || _.V2 === null) { return 'N/A'; }\n                    return _ && _.V2\n                });\n                var jurisdiction_data = jurisdiction_full_data.map(function (_) {\n                    //https://jira.us.kworld.kpmg.com/browse/NORCCMS-33\n                    if (typeof _ === 'undefined' || _ === null || _.V === null || _.V1 === null || _.V2 === null) { return 'N/A'; }\n                    return _ && _.V\n                });\n\n                var header_column = get_nonbase_trend_table_header_column(current_options);\n                //i.e. ['Arapahoe'] + [12, 13, 15]\n                var jurisdiction_labeled_data1 = [header_column['first']]\n                    .concat(jurisdiction_data1);\n\n                var jurisdiction_labeled_data2 = [header_column['second']]\n                    .concat(jurisdiction_data2);\n\n                label = is_analysis ? header_column['third'] : header_column['first'];\n\n                var jurisdiction_labeled_data = [label]\n                    .concat(jurisdiction_data);\n\n                //TODO: year_labeled_data is the only part of this which  comes from a scope, and which forces us to define the function at this depth in the code;\n                //if y... nope, also need year_datas above... nope that's passed in data!\n                var c3_column_data = [\n                    year_labeled_data\n                ].concat(is_analysis ? [\n                    jurisdiction_labeled_data1,\n                    jurisdiction_labeled_data2,\n                    jurisdiction_labeled_data\n                    //the potential diff should go list\n                ] : [jurisdiction_labeled_data]);\n\n                paint_trend_view(c3_column_data);\n            };\n\n            //In the same way that paint() is called by two different awaiters who may need to do their own calculation\n            //But it's not the same\n            //Because paint is called by two different awaiters, but it also gets different data (it just gets more years' worth of data; so it defers() multiple times, instead of one time)\n            //In the same way, this will need to also get different data, and be called by two different awaiters\n            ////Job of base_trend_awaiter is to take n years' worth of data, each year datum is a 1) County (nullable if they are at State level jurisdiction), 2) State, 3) National;\n            //And the base_trend_awaiter will turn it into a c3 format to consume\n\n            var base_trend_awaiter = function (error, year_datas) {\n\n                //Last challenge;\n                //Each object in year_datas array has s, and possibly c\n                //An array with three elements\n                //Each element is an object where keys are the jurisdictions, at whatever level is appropriate (county, state)\n                //last_jurisdiction_selected_id is the id of the last selected jurisdiction, at whatever level is appropriate (county, state)\n\n                var c3_column_data = [\n                    year_labeled_data\n                ]\n\n                if (year_datas.some(function (_) {\n                    return _['c']\n                })) {\n                    //Pushing an array onto the array\n                    c3_column_data.push(['County'].concat(\n                        year_datas.map(function (year_data) {\n\n                            var county_key = get_comparable_juris_id(last_jurisdiction_selected.id);\n                            ///-------------------v------------------v\n                            if (year_data['c'] === undefined || !(county_key in year_data['c'])) { return 'N/A'; }\n                            var datum = year_data['c'][county_key];\n\n                            if (typeof datum === 'undefined' || typeof datum.V === 'undefined') { return 'N/A'; }\n                            else { return datum.V; }\n                        })\n                    ));\n                }\n\n                var datum_trend_value_text = function (datum) {\n                    if ((datum !== undefined) && ('V' in datum)) {\n                        return datum.V;\n                    } else {\n                        return 'N/A';\n                    }\n                }\n\n                c3_column_data.push(['State'].concat(\n                    year_datas.map(function (year_data) {\n\n                        //TODO: Only necessary if they're nota lready in State!\n                        var state_key = get_comparable_juris_id(last_jurisdiction_selected.id, {\n                            geography: 's'\n                        });\n\n                        if (year_data['s'] === undefined || !(state_key in year_data['s'])) { return 'N/A'; }\n                        var datum = year_data['s'][state_key];\n\n                        return datum_trend_value_text(datum);\n                    })\n                ));\n\n                c3_column_data.push(['Nation'].concat(\n                    year_datas.map(function (year_data) {\n                        //https://jira.us.kworld.kpmg.com/projects/NORCCMS/issues/NORCCMS-46?filter=allopenissues\n                        if (!('n' in year_data) || year_data['n'] === undefined) { return 'N/A'; }\n                        var datum = year_data['n'][NaN];\n\n                        return datum_trend_value_text(datum);\n                    })\n                ))\n\n                paint_trend_view(c3_column_data);\n            };\n\n            //awaitAll will pass the accumulated arguments sent back to the deferrables\n            //in one array so that it must be unpacked\n\n            year_queue.awaitAll(get_option.analysis.is_base(year_opt) ? base_trend_awaiter : non_base_trend_awaiter);\n\n        }\n\n        function deactivate_tooltip_links() {\n\n            d_tooltip_container.selectAll('a').classed('active', false);\n        }\n\n        var on_click_tooltip = function (d) {\n            //https://groups.google.com/forum/#!topic/d3-js/lpezER89BOc\n            //Can delegate, just need to check\n            //TODO: Move this to a handler which reacts to:\n            //1) Clicking a different county\n            //2) Changing filter on the left; except year\n            //3) Clicking the tooltip button\n\n            if (d3.event.target.tagName.toLowerCase() === 'a') {\n                deactivate_tooltip_links();\n                d3.select(d3.event.target).classed('active', true);\n\n                if (d3.event.target.classList.contains('trend')) {\n\n                    load_trend_view();\n\n                    //Failed to execute 'contains' on 'DOMTokenList': The token provided ('County Profile') contains HTML space characters, which are not valid in tokens.\n                } else if (d3.event.target.classList.contains('profile')) {\n                    //Won't be using a queue\n                    load_county_profile_view('county');\n                } else if (d3.event.target.classList.contains('sprofile')) {\n                    load_county_profile_view('state');\n                } else if (d3.event.target.classList.contains('nprofile')) {\n                    load_county_profile_view('nation');\n                }\n            }\n        };\n\n        /* Tooltip Handling */\n        var d_tooltip_container = d_map_container\n            .append("div")\n            .classed({\n                'tooltip': true\n            })\n            .on('click', on_click_tooltip)\n\n        var d_close_icon = d_tooltip_container\n            .append('div')\n            .classed({\n                'close-icon': true\n            })\n            //Just do its background\n            //.text('X')\n            .on('click', function (d) {\n\n                //Move the tooltip icon back over\n                map_maximize(false);\n\n                //pin_tooltip(!tooltip_is_pinned, d.id, menuChange());\n                pin_tooltip(false, undefined, undefined);\n\n                d_map_container.classed({\n                    'view-showing': false\n                });\n            });\n\n        var d_tooltip = d_tooltip_container\n            .append('div')\n            .classed({\n                'info': true\n            });\n\n        d_tooltip\n\n        var d_view_links = d_tooltip_container\n            .append('footer')\n            .classed({\n                'links': true\n            });\n        //https://jira.us.kworld.kpmg.com/browse/NORCCMS-14\n        //What to call the collection of charts, data, in one SVG; not a "view", but a ...\n\n        d_view_links\n            .append('a')\n            .classed({\n                'trend': true\n            })\n            .text(get_string_by_id(false, false, { "english": "Trend view", "spanish": "Visualización de tendencias" }) + view_names)\n\n\n        d_view_links\n            .append('a')\n            .classed({\n                'profile': true\n            })\n            .text(view_2 + ' ' + view_names)\n\n        //UPDATES BEGIN STATE Profile\n        d_view_links\n            .append('a')\n            .classed({\n                'sprofile': true\n            })\n            .text(view_3 + ' ' + view_names)\n\n        d_view_links\n            .append('a')\n            .classed({\n                'nprofile': true\n            })\n            .text(view_4 + ' ' + view_names)\n\n        /* Zoom Handling */\n        function zoomed() {\n            g.attr("transform", "translate(" + d3.event.translate + ")scale(" + d3.event.scale + ")");\n            svg.selectAll(".state-border").style("stroke-width", 1 / Math.sqrt(zoom.scale()) + "px");\n\n            g_territorybox.selectAll("text").style("font-size", 8 / Math.sqrt(zoom.scale()) + "px");\n        };\n\n        /* State zoom-via-dropdown */\n        function state_zoom(id, level) {\n            level = level || "state";\n\n            if (id == 66) {\n                id = 66010;\n            };\n            if (id == 69) {\n                id = 69000;\n            };\n            if (id == 60) {\n                id = 60040;\n            };\n\n            var d = null;\n\n            if (id !== 0) {\n                g_states.selectAll("path").each(function (s) {\n                    if (s.id === id) {\n                        d = s;\n                        return;\n                    }\n                });\n                g_counties.selectAll("path").each(function (s) {\n                    if (s.id === id) {\n                        d = s;\n                        return;\n                    }\n                });\n                guam_county.selectAll("path").each(function (s) {\n                    if (s.id === id) {\n                        d = s;\n                        return;\n                    }\n                });\n\n                mp_county.selectAll("path").each(function (s) {\n                    if (id === 69000) {\n                        d = s;\n                        return;\n                    }\n                });\n                as_county.selectAll("path").each(function (s) {\n                    if (id === 60040) {\n                        d = s;\n                        return;\n                    }\n                });\n\n                var bounds = path.bounds(d),\n                    dx = bounds[1][0] - bounds[0][0],\n                    dy = bounds[1][1] - bounds[0][1],\n                    x = (bounds[0][0] + bounds[1][0]) / 2,\n                    y = (bounds[0][1] + bounds[1][1]) / 2,\n                    scale = 0.6 / Math.max(dx / map_opts.width, dy / map_opts.height);\n                if (scale > 8) {\n                    scale = 8;\n                };\n\n                translate = [map_opts.width / 2 - scale * x, map_opts.height / 2 - scale * y];\n            } else {\n                scale = 1;\n                translate = [0, 0];\n            }\n\n            svg.selectAll(".state-border")\n                .classed("active", function (s) { \n                    return (id !== 0 && s.id === id);\n                });\n\n            svg.selectAll("#counties path")\n                .classed("active", function (s) {\n                    return (id !== 0 && s.id === id);\n                });\n\n            g.transition()\n                .duration(750)\n                .style("stroke-width", 1.5 / scale + "px")\n                .attr("transform", "translate(" + translate + ")scale(" + scale + ")");\n\n            zoom.scale(scale);\n            zoom.translate(translate);\n\n            svg.selectAll(".state-border")\n                .style("stroke-width", 1 / Math.sqrt(zoom.scale()) + "px");\n\n            var node = d3.select(".active").node();\n            node.parentNode.appendChild(node);\n            if (level === "county") {\n                pin_tooltip(false, id, menuChange());\n                pin_tooltip(true, id, menuChange());\n                last_jurisdiction_selected = d;\n                d_tooltip_container.classed({ 'pinned': true });\n            }\n        };\n\n        function get_selection_array() {\n\n            var selections = [];\n            d3.selectAll("table select")[0].forEach(function (d) {\n                selections.push(d.options[d.selectedIndex].text);\n            });\n            return selections;\n\n        }\n\n        function get_title_array() {\n            // return ['Year', 'Geography', 'Measure', 'Adjustment', 'Analysis','Domain' ,'Condition', 'Sex', 'Age', 'Dual', 'Race', 'Eligibility', 'Comparison Sex', 'Comparison Age', 'Comparison Dual', 'Comparison Race', 'Comparison Eligibility'];\n            if (language === "english") {\n            return ['Population', 'Year' ,'Geography', 'Measure', 'Adjustment', 'Analysis', 'Domain', 'Condition', 'Sex', 'Age', 'Race', 'Dual', 'Eligibility', 'Comparison Sex', 'Comparison Age', 'Comparison Race', 'Comparison Dual', 'Comparison Eligibility'];\n        }\n            else{\n                return ['Población','Año', 'Geografía', 'Medida', 'Ajuste', 'Análisis','Dominio', 'Condición', 'Sexo', 'Edad', 'Raza y etnia', 'Doble elegibilidad', "Elegibilidad para Medicare", "Género de comparación", "Edad de comparación", "Raza y etnia de comparación", "Comparación de doble elegibilidad", "Comparación de la elegibilidad para Medicare"];\n            }\n        }\n\n        function get_selections() {\n            var result = {};\n            var a = get_selection_array();\n            //console.log(a);\n            var b = get_title_array();\n            b.forEach(function (_, i) {\n                result[_] = a[i];\n            })\n            return result;\n        }\n        /* Map Download function wrapper */\n        function image_download() {\n\n            var titles = get_title_array();\n\n            var selections = get_selection_array();\n\n             var footer = ['', '', '','', '', '']\n\n             //Function to calculate the width of text in pixels\n            function textWidth(text, font) {\n                let canvas = textWidth.canvas || (textWidth.canvas = document.createElement("canvas"));\n                let context = canvas.getContext("2d");\n                context.font = font;\n                let metrics = context.measureText(text);\n                return metrics.width;\n            }\n            var nextElement = ""\n            var i = 0\n            for (var j = 0; j <= 6; j++){ \n                var lineString = ""\n                while((i<selections.length) & (textWidth(lineString+nextElement, "10px arial"))<map_opts.width-20){ \n                    lineString += titles[i] + ': ' + selections[i]\n                    if (i<selections.length-1){\n                        lineString += ', '\n                    }\n                    nextElement = titles[i+1] + ': ' + selections[i+1]+ ', ';\n                    //console.log(textWidth(lineString, "10px arial"));\n                    i++;\n                }\n                footer[j] = lineString\n                //console.log(footer[j]);\n            }\n            /*    mid = Math.floor(selections.length / 2),\n                end = selections.length;\n\n            for (var i = 0; i < mid; i++) {\n                footer[0] += titles[i] + ': ' + selections[i];\n                if (i !== mid - 1) {\n                    footer[0] += ', ';\n                };\n            };\n\n            for (var i = mid; i < end; i++) {\n                footer[1] += titles[i] + ': ' + selections[i];\n                if (i !== end - 1) {\n                    footer[1] += ', ';\n                };\n            };*/\n\n            var t_g = svg.append("g")\n                .attr("transform", "translate(0," + (map_opts.height - 120) + ")");\n\n            t_g.append("rect")\n                .attr("x", 0)\n                .attr("height", 120)\n                .attr("width", map_opts.width)\n                .attr("fill", "white");\n//Label for CMS Office of Minority Health\n            t_g.append("text")\n                .attr("x", 20)\n                .attr("y", 40)\n                .text(get_string_by_id("307"));\n\n            t_g.append("text")\n                .attr("x", 20)\n                .attr("y", 50)\n                .style("font-size", "10px")\n                .text(footer[0]);\n\n            t_g.append("text")\n                .attr("x", 20)\n                .attr("y", 60)\n                .style("font-size", "10px")\n                .text(footer[1]);\n\n                t_g.append("text")\n                .attr("x", 20)\n                .attr("y", 70)\n                .style("font-size", "10px")\n                .text(footer[2]);\n\n            t_g.append("text")\n                .attr("x", 20)\n                .attr("y", 80)\n                .style("font-size", "10px")\n                .text(footer[3]);\n            \n            t_g.append("text")\n                .attr("x", 20)\n                .attr("y", 90)\n                .style("font-size", "10px")\n                .text(footer[4]);\n            \n            t_g.append("text")\n                .attr("x", 20)\n                .attr("y", 100)\n                .style("font-size", "10px")\n                .text(footer[5]);\n            \n            t_g.append("text")\n                .attr("x", 20)\n                .attr("y", 110)\n                .style("font-size", "10px")\n                .text(footer[6]);\n\n\n            var legenddata = d3.selectAll('.legendgroup').data();\n\n            var t_g_l = t_g.selectAll("g")\n                .data(legenddata).enter()\n                .append("g")\n                .attr("transform", function (d, i) {\n                    return "translate(" + (i * 40 + 20) + ",10)";\n                });\n\n            t_g_l.append("rect")\n                .attr("width", 40)\n                .attr("height", 10)\n                .attr("y", 5)\n                .attr("class", function (d) {\n                    return d.class;\n                });\n\n            t_g_l.append("text")\n                .attr("x", 0)\n                .attr("y", 2)\n                .style('font-size', '8px')\n                //TODO: 1) Can text-anchor be used as style, vs attr? 2) is left a valid value; use start instead? https://developer.mozilla.org/en-US/docs/Web/SVG/Attribute/text-anchor\n                .style('text-anchor', 'left')\n                .text(function (d, i) {\n                    if ((i > 0) && (i < legenddata.length - 1)) {\n                        return (d.label).substr(0, d.label.indexOf(' '));\n                    } else {\n                        return d.label;\n                    };\n                });\n\n            t_g.append('text')\n                .attr('x', function () {\n                    return legenddata.length * 40 + 25;\n                })\n                .attr('y', 23)\n                .text(d3.select('.legend-header').node().innerHTML)\n                .style('font-size', '10px');\n\n            t_g.append('rect')\n                .attr('x', map_opts.width - 30)\n                .attr('y', 15)\n                .attr('width', 20)\n                .attr('height', 10)\n                .attr('class', 'urban');\n                 //Adds urban label\n            t_g.append('text')\n                .attr('x', map_opts.width - 30 + 10)\n                .attr('y', 35)\n                .style('text-anchor', 'middle')\n                .style('font-size', '10px')\n                .text( get_string_by_id("308"));\n\n            saveSVG();\n            t_g.remove();\n        };\n\n        var strings = null;\n        var get_and_cache_strings = function (callback) {\n            if (strings) {\n                return callback(strings);\n            } else {\n                d3.json('/mmd-population/assets/strings.json', function (d) {\n                    strings = d;\n                    return callback(d);\n                });\n            }\n        };\n\n        var get_string = function (id, callback) {\n\n            language = get_or_set_language_cookie() || 'english';\n\n            return get_and_cache_strings(function (strings) {\n                return callback(strings[id][language]);\n            })\n        };\n\n        var d_population_report = container\n            .append("div")\n            .attr("id", "population-report")\n            .attr("class", "population-report")\n            .style("width", "690px")\n            .style("padding", "5px");\n\n        var d_population_report_header = d_population_report\n            .append("h3");\n\n        var d_population_report_paragraph = d_population_report\n            .append("p")\n            .text("");\n\n        var d_population_feedback_sentence = d_population_report\n            .append("p");\n\n        // Header Text\n        get_string("296", function (text) {\n            d_population_report_header.text(text);\n        });\n\n        // Main Paragraph Text\n        get_string("297", function (text) {\n            d_population_report_paragraph.text(text + " ");\n\n            var d_population_report_link = d_population_report_paragraph.append("a")\n                .attr("href", function () {\n                    var language = get_or_set_language_cookie();\n                    if (language === 'english') {\n                        return "/mmd-population/downloads/Population_Report_2018_June_2020.zip";\n                    } else {\n                        return "/mmd-population/downloads/Population_Report_2018_June_2020_-_Espanol.zip";\n                    }\n                })\n                .style("text-decoration", "underline");\n\n            // Link Text\n            get_string("299", function (text) {\n                d_population_report_link.text(text);\n            });\n        });\n\n        // Feedback Text\n        get_string("298", function (text) {\n            d_population_feedback_sentence\n                .text(text + " ")\n                .append("a")\n                .attr("href", "mailto:HealthEquityTA@cms.hhs.gov")\n                .text("HealthEquityTA@cms.hhs.gov");\n        });\n\n    \x3C/script>\n\n\n\n</body></html>`